(1, '2015-12-25 16:24:12', 'NEW_USER', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#DEFAULT_EMAIL_FROM#', '#SITE_NAME#: Зарегистрировался новый пользователь', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nНа сайте #SERVER_NAME# успешно зарегистрирован новый пользователь.\n\nДанные пользователя:\nID пользователя: #USER_ID#\n\nИмя: #NAME#\nФамилия: #LAST_NAME#\nE-Mail: #EMAIL#\n\nLogin: #LOGIN#\n\nПисьмо сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\n\nНа сайте <?=$arParams[\"SERVER_NAME\"];?> успешно зарегистрирован новый пользователь.\n\nДанные пользователя:\nID пользователя: <?=$arParams[\"USER_ID\"];?>\n\n\nИмя: <?=$arParams[\"NAME\"];?>\n\nФамилия: <?=$arParams[\"LAST_NAME\"];?>\n\nE-Mail: <?=$arParams[\"EMAIL\"];?>\n\n\nLogin: <?=$arParams[\"LOGIN\"];?>\n\n\nПисьмо сгенерировано автоматически.', NULL, NULL),
(2, '2016-01-05 00:21:40', 'USER_INFO', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', 'Добро пожаловать к Экспертам Битрикс', '#NAME# #LAST_NAME#,\r\n\r\n#MESSAGE#\r\n\r\nВаша регистрационная информация:\r\n\r\nID пользователя: #USER_ID#\r\nСтатус профиля: #STATUS#\r\nLogin: #LOGIN#\r\n\r\nПожалуйста, смените пароль от своей учётной записи по ссылке:\r\nhttp://#SERVER_NAME#/auth/index.php?change_password=yes&lang=ru&USER_CHECKWORD=#CHECKWORD#&USER_LOGIN=#LOGIN#\r\n\r\n----\r\nЛюблю, целую\r\nПочтовый робот', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, '<?=$arParams[\"NAME\"];?> <?=$arParams[\"LAST_NAME\"];?>,\r\n\r\n<?=$arParams[\"MESSAGE\"];?>\r\n\r\n\r\nВаша регистрационная информация:\r\n\r\nID пользователя: <?=$arParams[\"USER_ID\"];?>\r\n\r\nСтатус профиля: <?=$arParams[\"STATUS\"];?>\r\n\r\nLogin: <?=$arParams[\"LOGIN\"];?>\r\n\r\n\r\nПожалуйста, смените пароль от своей учётной записи по ссылке:\r\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/auth/index.php?change_password=yes&lang=ru&USER_CHECKWORD=<?=$arParams[\"CHECKWORD\"];?>&USER_LOGIN=<?=$arParams[\"LOGIN\"];?>\r\n\r\n\r\n----\r\nЛюблю, целую\r\nПочтовый робот', '', 'a:0:{}'),
(3, '2015-12-29 16:55:01', 'USER_PASS_REQUEST', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', 'Запрос на смену пароля', '#NAME# #LAST_NAME#,\r\n\r\n#MESSAGE#\r\n\r\nДля смены пароля перейдите по следующей ссылке:\r\nhttp://#SERVER_NAME#/auth/index.php?change_password=yes&lang=ru&USER_CHECKWORD=#CHECKWORD#&USER_LOGIN=#LOGIN#\r\n\r\nВаша регистрационная информация:\r\n\r\nID пользователя: #USER_ID#\r\nСтатус профиля: #STATUS#\r\nLogin: #LOGIN#\r\n\r\n----\r\nЛюблю, целую\r\nПочтовый робот', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, '<?=$arParams[\"NAME\"];?> <?=$arParams[\"LAST_NAME\"];?>,\r\n\r\n<?=$arParams[\"MESSAGE\"];?>\r\n\r\n\r\nДля смены пароля перейдите по следующей ссылке:\r\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/auth/index.php?change_password=yes&lang=ru&USER_CHECKWORD=<?=$arParams[\"CHECKWORD\"];?>&USER_LOGIN=<?=$arParams[\"LOGIN\"];?>\r\n\r\n\r\nВаша регистрационная информация:\r\n\r\nID пользователя: <?=$arParams[\"USER_ID\"];?>\r\n\r\nСтатус профиля: <?=$arParams[\"STATUS\"];?>\r\n\r\nLogin: <?=$arParams[\"LOGIN\"];?>\r\n\r\n\r\n----\r\nЛюблю, целую\r\nПочтовый робот', '', 'a:0:{}'),
(4, '2015-12-29 16:55:20', 'USER_PASS_CHANGED', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', 'Подтверждение смены пароля', '#NAME# #LAST_NAME#,\r\n\r\n#MESSAGE#\r\n\r\nВаша регистрационная информация:\r\n\r\nID пользователя: #USER_ID#\r\nСтатус профиля: #STATUS#\r\nLogin: #LOGIN#\r\n\r\n----\r\nЛюблю, целую\r\nПочтовый робот', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, '<?=$arParams[\"NAME\"];?> <?=$arParams[\"LAST_NAME\"];?>,\r\n\r\n<?=$arParams[\"MESSAGE\"];?>\r\n\r\n\r\nВаша регистрационная информация:\r\n\r\nID пользователя: <?=$arParams[\"USER_ID\"];?>\r\n\r\nСтатус профиля: <?=$arParams[\"STATUS\"];?>\r\n\r\nLogin: <?=$arParams[\"LOGIN\"];?>\r\n\r\n\r\n----\r\nЛюблю, целую\r\nПочтовый робот', '', 'a:0:{}'),
(5, '2015-12-21 17:24:34', 'NEW_USER_CONFIRM', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', 'Добро пожаловать к Экспертам Битрикс', 'Добро пожаловать.\r\n\r\nВаш код для подтверждения регистрации: #CONFIRM_CODE#\r\n\r\nДля подтверждения регистрации перейдите по следующей ссылке:\r\nhttp://#SERVER_NAME#/auth/index.php?confirm_registration=yes&confirm_user_id=#USER_ID#&confirm_code=#CONFIRM_CODE#\r\n\r\nВы также можете ввести код для подтверждения регистрации на странице:\r\nhttp://#SERVER_NAME#/auth/index.php?confirm_registration=yes&confirm_user_id=#USER_ID#\r\n\r\nВнимание! Ваш профиль не будет активным, пока вы не подтвердите свою регистрацию.\r\n\r\n----\r\nЛюблю, целую,\r\nПочтовый Робот', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', 'a:0:{}'),
(6, '2015-12-21 17:24:34', 'USER_INVITE', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', 'Приглашение на сайт Эксперты Битрикс', 'Здравствуйте, #NAME# #LAST_NAME#!\r\n\r\nАдминистратором сайта вы добавлены в число зарегистрированных пользователей.\r\nПриглашаем Вас на наш сайт.\r\n\r\nLogin: #LOGIN#\r\n\r\nУстановить, пожалуйста, пароль к своей учётной записи:\r\nhttp://#SERVER_NAME#/auth.php?change_password=yes&USER_LOGIN=#URL_LOGIN#&USER_CHECKWORD=#CHECKWORD#\r\n', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', 'a:0:{}'),
(7, '2013-09-19 07:21:14', 'FEEDBACK_FORM', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '#SITE_NAME#: Сообщение из формы обратной связи', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nВам было отправлено сообщение через форму обратной связи\n\nАвтор: #AUTHOR#\nE-mail автора: #AUTHOR_EMAIL#\n\nТекст сообщения:\n#TEXT#\n\nСообщение сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(25, '2013-09-19 07:21:33', 'FORUM_NEW_MESSAGE_MAIL', 's1', 'Y', '#FROM_EMAIL#', '#RECIPIENT#', '#TOPIC_TITLE#', '#MESSAGE_TEXT#\n\n------------------------------------------  \nВы получили это сообщение, так как выподписаны на форум #FORUM_NAME#.\n\nОтветить на сообщение можно по электронной почте или через форму на сайте:\nhttp://#SERVER_NAME##PATH2FORUM#\n\nНаписать новое сообщение: #FORUM_EMAIL#\n\nАвтор сообщения: #AUTHOR#\n\nСообщение сгенерировано автоматически на сайте #SITE_NAME#.\n', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, '2013-09-19 07:21:37', 'NEW_LEARNING_TEXT_ANSWER', 's1', 'Y', '#EMAIL_FROM#', '#EMAIL_TO#', '#SITE_NAME#: #COURSE_NAME#: #MESSAGE_TITLE#', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nКурс:#COURSE_NAME#\nТест:#TEST_NAME#\n\nПользователь: #USER#\nДата: #DATE#\n\nВопрос:\n------------------------------------------\n#QUESTION_TEXT#\n------------------------------------------\n\nОтвет:\n------------------------------------------\n#ANSWER_TEXT#\n------------------------------------------\n\nДля просмотра и редактирования ответа воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/learn_test_result_edit.php?lang=ru&ID=#ID#&ATTEMPT_ID=#ATTEMPT_ID#\n\nСообщение сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, '2013-09-19 07:21:45', 'SALE_NEW_ORDER', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SITE_NAME#: Новый заказ N#ORDER_ID#', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"ru\" lang=\"ru\">\n<head>\n	<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\"/>\n	<style>\n		body \n		{\n			font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n			font-size: 14px;\n			color: #000;\n		}\n	</style>\n</head>\n<body>\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"850\" style=\"background-color: #d1d1d1; border-radius: 2px; border:1px solid #d1d1d1; margin: 0 auto;\" border=\"1\" bordercolor=\"#d1d1d1\">\n	<tr>\n		<td height=\"83\" width=\"850\" bgcolor=\"#eaf3f5\" style=\"border: none; padding-top: 23px; padding-right: 17px; padding-bottom: 24px; padding-left: 17px;\">\n			<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n				<tr>\n					<td bgcolor=\"#ffffff\" height=\"75\" style=\"font-weight: bold; text-align: center; font-size: 26px; color: #0b3961;\">Вами оформлен заказ в магазине #SITE_NAME#</td>\n				</tr>\n				<tr>\n					<td bgcolor=\"#bad3df\" height=\"11\"></td>\n				</tr>\n			</table>\n		</td>\n	</tr>\n	<tr>\n		<td width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 16px; padding-left: 44px;\">\n			<p style=\"margin-top:30px; margin-bottom: 28px; font-weight: bold; font-size: 19px;\">Уважаемый #ORDER_USER#,</p>\n			<p style=\"margin-top: 0; margin-bottom: 20px; line-height: 20px;\">Ваш заказ номер #ORDER_ID# от #ORDER_DATE# принят.<br />\n<br />\nСтоимость заказа: #PRICE#.<br />\n<br />\nСостав заказа:<br />\n#ORDER_LIST#<br />\n<br />\nВы можете следить за выполнением своего заказа (на какой стадии выполнения он находится), войдя в Ваш персональный раздел сайта #SITE_NAME#. <br />\n<br />\nОбратите внимание, что для входа в этот раздел Вам необходимо будет ввести логин и пароль пользователя сайта #SITE_NAME#.<br />\n<br />\nДля того, чтобы аннулировать заказ, воспользуйтесь функцией отмены заказа, которая доступна в Вашем персональном разделе сайта #SITE_NAME#.<br />\n<br />\nПожалуйста, при обращении к администрации сайта #SITE_NAME# ОБЯЗАТЕЛЬНО указывайте номер Вашего заказа - #ORDER_ID#.<br />\n<br />\nСпасибо за покупку!<br />\n</p>\n		</td>\n	</tr>\n	<tr>\n		<td height=\"40px\" width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 30px; padding-left: 44px;\">\n			<p style=\"border-top: 1px solid #d1d1d1; margin-bottom: 5px; margin-top: 0; padding-top: 20px; line-height:21px;\">С уважением,<br />администрация <a href=\"http://#SERVER_NAME#\" style=\"color:#2e6eb6;\">Интернет-магазина</a><br />\n				E-mail: <a href=\"mailto:#SALE_EMAIL#\" style=\"color:#2e6eb6;\">#SALE_EMAIL#</a>\n			</p>\n		</td>\n	</tr>\n</table>\n</body>\n</html>', 'html', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
