(38, '2013-09-19 07:21:45', 'SALE_SUBSCRIBE_PRODUCT', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SITE_NAME#: Уведомление о поступлении товара', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"ru\" lang=\"ru\">\n<head>\n	<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\"/>\n	<style>\n		body \n		{\n			font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n			font-size: 14px;\n			color: #000;\n		}\n	</style>\n</head>\n<body>\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"850\" style=\"background-color: #d1d1d1; border-radius: 2px; border:1px solid #d1d1d1; margin: 0 auto;\" border=\"1\" bordercolor=\"#d1d1d1\">\n	<tr>\n		<td height=\"83\" width=\"850\" bgcolor=\"#eaf3f5\" style=\"border: none; padding-top: 23px; padding-right: 17px; padding-bottom: 24px; padding-left: 17px;\">\n			<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n				<tr>\n					<td bgcolor=\"#ffffff\" height=\"75\" style=\"font-weight: bold; text-align: center; font-size: 26px; color: #0b3961;\">Уведомление о поступлении товара в магазин #SITE_NAME#</td>\n				</tr>\n				<tr>\n					<td bgcolor=\"#bad3df\" height=\"11\"></td>\n				</tr>\n			</table>\n		</td>\n	</tr>\n	<tr>\n		<td width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 16px; padding-left: 44px;\">\n			<p style=\"margin-top:30px; margin-bottom: 28px; font-weight: bold; font-size: 19px;\">Уважаемый, #USER_NAME#!</p>\n			<p style=\"margin-top: 0; margin-bottom: 20px; line-height: 20px;\">Товар \"#NAME#\" (#PAGE_URL#) поступил на склад.<br />\n<br />\nВы можете Оформить заказ (http://#SERVER_NAME#/personal/cart/).<br />\n<br />\nНе забудьте авторизоваться!<br />\n<br />\nВы получили это сообщение по Вашей просьбе оповестить при появлении товара.<br />\nНе отвечайте на него - письмо сформировано автоматически.<br />\n<br />\nСпасибо за покупку!<br />\n</p>\n		</td>\n	</tr>\n	<tr>\n		<td height=\"40px\" width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 30px; padding-left: 44px;\">\n			<p style=\"border-top: 1px solid #d1d1d1; margin-bottom: 5px; margin-top: 0; padding-top: 20px; line-height:21px;\">С уважением,<br />администрация <a href=\"http://#SERVER_NAME#\" style=\"color:#2e6eb6;\">Интернет-магазина</a><br />\n				E-mail: <a href=\"mailto:#SALE_EMAIL#\" style=\"color:#2e6eb6;\">#SALE_EMAIL#</a>\n			</p>\n		</td>\n	</tr>\n</table>\n</body>\n</html>', 'html', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(39, '2013-09-19 07:21:45', 'SALE_NEW_ORDER_RECURRING', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SITE_NAME#: Новый заказ N#ORDER_ID# на продление подписки', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nУважаемый #ORDER_USER#,\n\nВаш заказ номер #ORDER_ID# от #ORDER_DATE# на продление подписки принят.\n\nСтоимость заказа: #PRICE#.\n\nСостав заказа:\n#ORDER_LIST#\n\nВы можете следить за выполнением своего заказа (на какой\nстадии выполнения он находится), войдя в Ваш персональный\nраздел сайта #SITE_NAME#. Обратите внимание, что для входа\nв этот раздел Вам необходимо будет ввести логин и пароль\nпользователя сайта #SITE_NAME#.\n\nДля того, чтобы аннулировать заказ, воспользуйтесь функцией\nотмены заказа, которая доступна в Вашем персональном\nразделе сайта #SITE_NAME#.\n\nПожалуйста, при обращении к администрации сайта #SITE_NAME#\nОБЯЗАТЕЛЬНО указывайте номер Вашего заказа - #ORDER_ID#.\n\nСпасибо за покупку!\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(40, '2013-09-19 07:21:45', 'SALE_RECURRING_CANCEL', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SITE_NAME#: Подписка отменена', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nПодписка отменена\n\n#CANCELED_REASON#\n#SITE_NAME#\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, '2013-09-19 07:21:45', 'SALE_STATUS_CHANGED_F', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SERVER_NAME#: Изменение статуса заказа N#ORDER_ID#', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"ru\" lang=\"ru\">\n<head>\n	<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\"/>\n	<style>\n		body \n		{\n			font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n			font-size: 14px;\n			color: #000;\n		}\n	</style>\n</head>\n<body>\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"850\" style=\"background-color: #d1d1d1; border-radius: 2px; border:1px solid #d1d1d1; margin: 0 auto;\" border=\"1\" bordercolor=\"#d1d1d1\">\n	<tr>\n		<td height=\"83\" width=\"850\" bgcolor=\"#eaf3f5\" style=\"border: none; padding-top: 23px; padding-right: 17px; padding-bottom: 24px; padding-left: 17px;\">\n			<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n				<tr>\n					<td bgcolor=\"#ffffff\" height=\"75\" style=\"font-weight: bold; text-align: center; font-size: 26px; color: #0b3961;\"></td>\n				</tr>\n				<tr>\n					<td bgcolor=\"#bad3df\" height=\"11\"></td>\n				</tr>\n			</table>\n		</td>\n	</tr>\n	<tr>\n		<td width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 16px; padding-left: 44px;\">\n			<p style=\"margin-top:30px; margin-bottom: 28px; font-weight: bold; font-size: 19px;\"></p>\n			<p style=\"margin-top: 0; margin-bottom: 20px; line-height: 20px;\">Информационное сообщение сайта #SITE_NAME#<br />\n------------------------------------------<br />\n<br />\nСтатус заказа номер #ORDER_ID# от #ORDER_DATE# изменен.<br />\n<br />\nНовый статус заказа:<br />\n#ORDER_STATUS#<br />\n#ORDER_DESCRIPTION#<br />\n#TEXT#<br />\n<br />\nДля получения подробной информации по заказу пройдите на сайт #SERVER_NAME#/personal/order/#ORDER_ID#/<br />\n<br />\nСпасибо за ваш выбор!<br />\n#SITE_NAME#<br />\n</p>\n		</td>\n	</tr>\n	<tr>\n		<td height=\"40px\" width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 30px; padding-left: 44px;\">\n			<p style=\"border-top: 1px solid #d1d1d1; margin-bottom: 5px; margin-top: 0; padding-top: 20px; line-height:21px;\">С уважением,<br />администрация <a href=\"http://#SERVER_NAME#\" style=\"color:#2e6eb6;\">Интернет-магазина</a><br />\n				E-mail: <a href=\"mailto:#SALE_EMAIL#\" style=\"color:#2e6eb6;\">#SALE_EMAIL#</a>\n			</p>\n		</td>\n	</tr>\n</table>\n</body>\n</html>', 'html', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(42, '2013-09-19 07:21:45', 'SALE_STATUS_CHANGED_N', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SERVER_NAME#: Изменение статуса заказа N#ORDER_ID#', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"ru\" lang=\"ru\">\n<head>\n	<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\"/>\n	<style>\n		body \n		{\n			font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n			font-size: 14px;\n			color: #000;\n		}\n	</style>\n</head>\n<body>\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"850\" style=\"background-color: #d1d1d1; border-radius: 2px; border:1px solid #d1d1d1; margin: 0 auto;\" border=\"1\" bordercolor=\"#d1d1d1\">\n	<tr>\n		<td height=\"83\" width=\"850\" bgcolor=\"#eaf3f5\" style=\"border: none; padding-top: 23px; padding-right: 17px; padding-bottom: 24px; padding-left: 17px;\">\n			<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n				<tr>\n					<td bgcolor=\"#ffffff\" height=\"75\" style=\"font-weight: bold; text-align: center; font-size: 26px; color: #0b3961;\"></td>\n				</tr>\n				<tr>\n					<td bgcolor=\"#bad3df\" height=\"11\"></td>\n				</tr>\n			</table>\n		</td>\n	</tr>\n	<tr>\n		<td width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 16px; padding-left: 44px;\">\n			<p style=\"margin-top:30px; margin-bottom: 28px; font-weight: bold; font-size: 19px;\"></p>\n			<p style=\"margin-top: 0; margin-bottom: 20px; line-height: 20px;\">Информационное сообщение сайта #SITE_NAME#<br />\n------------------------------------------<br />\n<br />\nСтатус заказа номер #ORDER_ID# от #ORDER_DATE# изменен.<br />\n<br />\nНовый статус заказа:<br />\n#ORDER_STATUS#<br />\n#ORDER_DESCRIPTION#<br />\n#TEXT#<br />\n<br />\nДля получения подробной информации по заказу пройдите на сайт #SERVER_NAME#/personal/order/#ORDER_ID#/<br />\n<br />\nСпасибо за ваш выбор!<br />\n#SITE_NAME#<br />\n</p>\n		</td>\n	</tr>\n	<tr>\n		<td height=\"40px\" width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 30px; padding-left: 44px;\">\n			<p style=\"border-top: 1px solid #d1d1d1; margin-bottom: 5px; margin-top: 0; padding-top: 20px; line-height:21px;\">С уважением,<br />администрация <a href=\"http://#SERVER_NAME#\" style=\"color:#2e6eb6;\">Интернет-магазина</a><br />\n				E-mail: <a href=\"mailto:#SALE_EMAIL#\" style=\"color:#2e6eb6;\">#SALE_EMAIL#</a>\n			</p>\n		</td>\n	</tr>\n</table>\n</body>\n</html>', 'html', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(43, '2013-09-19 07:21:47', 'VIRUS_DETECTED', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', '#SITE_NAME#: Обнаружен вирус', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nЗдравствуйте!\n\nВы получили это сообщение, так как модуль проактивной защиты сервера #SERVER_NAME# обнаружил код, похожий на вирус.\n\n1. Подозрительный код был вырезан из html.\n2. Проверьте журнал вторжений и убедитесь, что код действительно вредоносный, а не является кодом какого-либо счетчика или фреймворка.\n (ссылка: http://#SERVER_NAME#/bitrix/admin/event_log.php?lang=ru&set_filter=Y&find_type=audit_type_id&find_audit_type[]=SECURITY_VIRUS )\n3. В случае, если код не является опасным, добавьте его в исключения на странице настройки антивируса.\n (ссылка: http://#SERVER_NAME#/bitrix/admin/security_antivirus.php?lang=ru&tabControl_active_tab=exceptions )\n4. Если код является вирусным, то необходимо выполнить следующие действия:\n\n а) Смените пароли доступа к сайту у администраторов и ответственных сотрудников.\n б) Смените пароли доступа по ssh и ftp.\n в) Проверьте и вылечите компьютеры администраторов, имевших доступ к сайту по ssh или ftp.\n г) В программах доступа к сайту по ssh и ftp отключите сохранение паролей.\n д) Удалите вредоносный код из зараженных файлов. Например, восстановите поврежденные файлы из самой свежей резервной копии.\n\n---------------------------------------------------------------------\nСообщение сгенерировано автоматически.\n', 'text', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(53, '2015-12-21 17:24:34', 'STATISTIC_DAILY_REPORT', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '#SERVER_NAME#: Статистика сайта (#SERVER_TIME#)', '#HTML_HEADER#\n<font class=\'h2\'>Обобщенная статистика сайта <font color=\'#A52929\'>#SITE_NAME#</font><br>\nДанные на <font color=\'#0D716F\'>#SERVER_TIME#</font></font>\n<br><br>\n<a class=\'tablebodylink\' href=\'http://#SERVER_NAME#/bitrix/admin/stat_list.php?lang=ru\'>http://#SERVER_NAME#/bitrix/admin/stat_list.php?lang=ru</a>\n<br>\n<hr><br>\n#HTML_COMMON#\n<br>\n#HTML_ADV#\n<br>\n#HTML_REFERERS#\n<br>\n#HTML_PHRASES#\n<br>\n#HTML_SEARCHERS#\n<br>\n#HTML_EVENTS#\n<br>\n<hr>\n<a class=\'tablebodylink\' href=\'http://#SERVER_NAME#/bitrix/admin/stat_list.php?lang=ru\'>http://#SERVER_NAME#/bitrix/admin/stat_list.php?lang=ru</a>\n#HTML_FOOTER#\n', 'html', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(54, '2015-12-21 17:24:34', 'STATISTIC_ACTIVITY_EXCEEDING', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '#SERVER_NAME#: Превышен лимит активности', 'На сайте #SERVER_NAME# посетитель превысил установленный лимит активности.\n\nНачиная с #CURRENT_TIME# посетитель заблокирован на #DELAY_TIME# сек.\n\nАктивность  - #ACTIVITY_HITS# хитов за #ACTIVITY_TIME_LIMIT# сек. (лимит - #ACTIVITY_HITS_LIMIT#)\nПосетитель  - #VISITOR_ID#\nСессия      - #SESSION_ID#\nПоисковик   - [#SERACHER_ID#] #SEARCHER_NAME#\nUserAgent   - #USER_AGENT#\n\n>===============================================================================================\nДля добавления в стоп-лист воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##STOPLIST_LINK#\nДля просмотра сессии посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##SESSION_LINK#\nДля просмотра профайла посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##VISITOR_LINK#\nДля просмотра статистики хитов поисковика воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##SEARCHER_LINK#\n', 'text', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(67, '2016-09-07 07:43:47', 'COMMUNITY_REQUEST', NULL, 'Y', '#DEFAULT_EMAIL_FROM#', 'team@bitrix.expert', 'Запрос на вступление в сообщество', 'Привет.\r\nПоступила заявка на вступление в сообщество от пользователя #USERNAME# (№#USERID#).\r\nskype: #SKYPE#\r\n\r\nВопрос:\r\n--\r\n#QUESTION#\r\n--\r\nОтвет:\r\n--\r\n#ANSWER#\r\n--', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, 'Привет.\r\nПоступила заявка на вступление в сообщество от пользователя <?=$arParams[\"USERNAME\"];?> (№<?=$arParams[\"USERID\"];?>).\r\nskype: <?=$arParams[\"SKYPE\"];?>\r\n\r\n\r\nВопрос:\r\n--\r\n<?=$arParams[\"QUESTION\"];?>\r\n\r\n--\r\nОтвет:\r\n--\r\n<?=$arParams[\"ANSWER\"];?>\r\n\r\n--', '', 'a:0:{}'),
(68, '2016-09-07 07:43:47', 'DEVELOPER_REQUEST', NULL, 'Y', '#DEFAULT_EMAIL_FROM#', 'team@bitrix.expert', 'Запрос на бейджик', 'Привет.\r\nПоступила заявка на вступление в сообщество от пользователя #USERNAME# (№#USERID#).\r\nskype: #SKYPE#\r\n\r\nВопрос:\r\n--\r\n#QUESTION#\r\n--\r\nОтвет:\r\n--\r\n#ANSWER#\r\n--', 'text', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, '', 'a:0:{}'),
(69, '2016-09-07 07:43:47', 'WF_STATUS_CHANGE', NULL, 'Y', '#DEFAULT_EMAIL_FROM#', '#ENTERED_BY_EMAIL#, #ADMIN_EMAIL#', '#SITE_NAME#: Изменен статус документа # #ID#', 'Изменен статус документа # #ID# на сайте #SITE_NAME#.\n---------------------------------------------------------------------------\n\nСейчас поля документа имеют следующие значения:\n\nИмя файла    - #FILENAME#\nЗаголовок    - #TITLE#\nСтатус       - [#STATUS_ID#] #STATUS_TITLE#; предыдущий - [#PREV_STATUS_ID#] #PREV_STATUS_TITLE#\nСоздан       - #DATE_ENTER#; [#ENTERED_BY_ID#] #ENTERED_BY_NAME#\nИзменен      - #DATE_MODIFY#; [#MODIFIED_BY_ID#] #MODIFIED_BY_NAME#\n\nСодержимое (тип - #BODY_TYPE#):\n---------------------------------------------------------------------------\n#BODY_TEXT#\n---------------------------------------------------------------------------\n\nКомментарий:\n---------------------------------------------------------------------------\n#COMMENTS#\n---------------------------------------------------------------------------\n\nДля просмотра и редактирования документа воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/workflow_edit.php?lang=ru&ID=#ID#\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(70, '2016-09-07 07:43:47', 'WF_NEW_DOCUMENT', NULL, 'Y', '#DEFAULT_EMAIL_FROM#', '#ENTERED_BY_EMAIL#, #ADMIN_EMAIL#', '#SITE_NAME#: Создан новый документ', 'Создан новый документ на сайте #SITE_NAME#.\n---------------------------------------------------------------------------\n\nСейчас поля документа имеют следующие значения:\n\nID           - #ID#\nИмя файла    - #FILENAME#\nЗаголовок    - #TITLE#\nСтатус       - [#STATUS_ID#] #STATUS_TITLE#\nСоздан       - #DATE_ENTER#; [#ENTERED_BY_ID#] #ENTERED_BY_NAME#\n\nСодержимое (тип - #BODY_TYPE#):\n---------------------------------------------------------------------------\n#BODY_TEXT#\n---------------------------------------------------------------------------\n\nКомментарий:\n---------------------------------------------------------------------------\n#COMMENTS#\n---------------------------------------------------------------------------\n\nДля просмотра и редактирования документа воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/workflow_edit.php?lang=ru&ID=#ID#\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(71, '2016-09-07 07:43:47', 'WF_IBLOCK_STATUS_CHANGE', NULL, 'Y', '#DEFAULT_EMAIL_FROM#', '#CREATED_BY_EMAIL#, #ADMIN_EMAIL#', '#SITE_NAME#: Изменен статус элемента # #ID# информационного блока # #IBLOCK_ID# (тип - #IBLOCK_TYPE#)', '#SITE_NAME#: Изменен статус элемента # #ID# информационного блока # #IBLOCK_ID# (тип - #IBLOCK_TYPE#)\n---------------------------------------------------------------------------\n\nСейчас поля элемента имеют следующие значения:\n\nНаименование - #NAME#\nСтатус       - [#STATUS_ID#] #STATUS_TITLE#; предыдущий - [#PREV_STATUS_ID#] #PREV_STATUS_TITLE#\nСоздан       - #DATE_CREATE#; [#CREATED_BY_ID#] #CREATED_BY_NAME#\nИзменен      - #DATE_MODIFY#; [#MODIFIED_BY_ID#] #MODIFIED_BY_NAME#\n\nАнонс (тип - #PREVIEW_TYPE#):\n---------------------------------------------------------------------------\n#PREVIEW_TEXT#\n---------------------------------------------------------------------------\n\nДетальное описание (тип - #DETAIL_TYPE#):\n---------------------------------------------------------------------------\n#DETAIL_TEXT#\n---------------------------------------------------------------------------\n\nКомментарий:\n---------------------------------------------------------------------------\n#COMMENTS#\n---------------------------------------------------------------------------\n\nДля просмотра и редактирования элемента воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/iblock_element_edit.php?lang=ru&WF=Y&PID=#ID#&type=#IBLOCK_TYPE#&IBLOCK_ID=#IBLOCK_ID#&filter_section=#SECTION_ID#\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(72, '2016-09-07 07:43:47', 'WF_NEW_IBLOCK_ELEMENT', NULL, 'Y', '#DEFAULT_EMAIL_FROM#', '#CREATED_BY_EMAIL#, #ADMIN_EMAIL#', '#SITE_NAME#: Создан новый элемент информационного блока # #IBLOCK_ID# (тип - #IBLOCK_TYPE#)', '#SITE_NAME#: Создан новый элемент информационного блока # #IBLOCK_ID# (тип - #IBLOCK_TYPE#)\n---------------------------------------------------------------------------\n\nСейчас поля элемента имеют следующие значения:\n\nНаименование - #NAME#\nСтатус       - [#STATUS_ID#] #STATUS_TITLE#\nСоздан       - #DATE_CREATE#; [#CREATED_BY_ID#] #CREATED_BY_NAME#\n\nАнонс (тип - #PREVIEW_TYPE#):\n---------------------------------------------------------------------------\n#PREVIEW_TEXT#\n---------------------------------------------------------------------------\n\nДетальное описание (тип - #DETAIL_TYPE#):\n---------------------------------------------------------------------------\n#DETAIL_TEXT#\n---------------------------------------------------------------------------\n\nКомментарий:\n---------------------------------------------------------------------------\n#COMMENTS#\n---------------------------------------------------------------------------\n\nДля просмотра и редактирования элемента воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/iblock_element_edit.php?lang=ru&WF=Y&PID=#ID#&type=#IBLOCK_TYPE#&IBLOCK_ID=#IBLOCK_ID#&filter_section=#SECTION_ID#\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
