(1, 1, NULL, 1, 0.000360012, 'statistic', 'bitrix:pull.request', '\n				SELECT\n					ID,\n					MESSAGE,\n					MESSAGE_LID,\n					SAVE_STATISTIC,\n					URL_REDIRECT,\n					TEST\n				FROM\n					b_stop_list\n				WHERE\n					ACTIVE=\'Y\'\n				and TEST=\'N\'\n				and (SITE_ID = \'s1\' or SITE_ID is null or length(SITE_ID)<=0)\n				and (DATE_START<=now() or DATE_START is null)\n				and (DATE_END>=now() or DATE_END is null)\n				and	((((MASK_1 & 195)=IP_1 and\n						(MASK_2 & 133)=IP_2 and\n						(MASK_3 & 194)=IP_3 and\n						(MASK_4 & 22)=IP_4)\n							or (IP_1 is null and IP_2 is null and IP_3 is null and IP_4 is null))\n						and (upper(\'Mozilla/5.0 (Windows NT 6.2; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.57 Safari/537.36\') like concat(\'%\',upper(USER_AGENT),\'%\')\n							or length(USER_AGENT)<=0 or USER_AGENT is null)\n						and (108=0 or USER_AGENT_IS_NULL<>\'Y\')\n						and (upper(\'http://dev.may-cat.ru/bitrix/admin/perfmon_panel.php?lang=ru\') like concat(\'%\',upper(URL_FROM),\'%\')\n							or length(URL_FROM)<=0 or URL_FROM is null)\n						and (upper(\'http://dev.may-cat.ru/bitrix/components/bitrix/pull.request/ajax.php?UPDATE_STATE\') like concat(\'%\',upper(URL_TO),\'%\')\n							or length(URL_TO)<=0 or URL_TO is null)\n					)\n				', NULL),
