(7, '2013-09-19 11:24:08', 'main', 's1|/about/faq/index.php', 0, NULL, NULL, NULL, '/about/faq/index.php', 'Помощь покупателю', 'В этом разделе вы можете найти ответы на многие вопросы, касающиеся работы нашего сайта. Если вы не нашли интересующей вас информации, то можете отправить нам запрос с помощью \rформы обратной связи\r.', '', '', '', 'eae19344e636dec436a80db2742bd70f', NULL, NULL),
(8, '2013-09-19 11:24:08', 'main', 's1|/about/contacts/index.php', 0, NULL, NULL, NULL, '/about/contacts/index.php', 'Задайте вопрос', 'Телефон:\r8 (495) 212 85 06\rАдрес:\rг. Москва, ул. 2-я Хуторская, д. 38\rПросмотреть увеличенную карту\rУважаемые покупатели!\rПрежде чем задать свой вопрос, обратите внимание на раздел \rПомощь покупателю\r. Возможно, там уже есть исчерпывающая информация по решению вашей проблемы.', '', '', '', 'eae19344e636dec436a80db2742bd70f', NULL, NULL),
(9, '2013-09-19 11:24:08', 'main', 's1|/about/howto/index.php', 0, NULL, NULL, NULL, '/about/howto/index.php', 'Как купить', 'Процедура покупки товара в нашем Интернет-магазине очень проста и состоит из нескольких шагов.\r1. Оформление заказа\rПосле выбора товара нажмите кнопку \rВ корзину\r— товар добавится в вашу корзину.\rДалее, если вы закончили выбирать товар, нажмите кнопку \rваша корзина\r.\rНа странице \rваша корзина\rбудут перечислены все выбранные вами товары.\rВ поле \rКоличество\rвы пожете изменить количество товара для покупки. После изменения количества товара необходимо нажать кнопку \rПересчитать\rдля пересчета итоговой суммы заказа.\nВ колонке \rДействия\rнад каждым товаром можно произвести следующие действия: либо \rудалить\rтовар из корзины, либо \rотложить\rтовар на будущее.\rТакже можно ввести код скидки в соответствующее поле.\r2. Оформление и подтверждение заказа\rПосле ввода необходимой информации о доставке товара (ФИО получателя, адрес доставки, контактные данные, вариант доставки, способ оплаты и т.д) для оформления заказа вам нужно нажать кнопку \rОформить заказ\r.\rКопия заказа будет выслана на ваш e-mail, указанный при оформлении заказа.\rВнимание!\rНеправильно указанный номер телефона, неточный или неполный адрес могут привести к дополнительной задержке! Пожалуйста, внимательно проверяйте ваши персональные данные при регистрации и оформлении заказа.\rЧерез некоторое время (обычно в течение часа) после оформления покупки, с вами свяжется наш менеджер по контактным данным, указанным при оформлении заказа. С менеджером можно будет согласовать точное время и сроки доставки, а также уточнить детали.\rПримечание\r: Для постоянных клиентов на сайте магазина есть \rРегистрация\r. В своем кабинете вы можете просмотреть содержимое корзины, историю своих заказов, а также повторить или отказаться от заказа, подписаться на рассылку новостей магазина.\r3. Оплата и цены\rЦены, указанные на сайте, являются окончательными и не требуют доплат при стандартных условиях поставки. Все налоги включены в стоимость товара.\rВнимание!\rДля каждого отдельного заказа возможен только один способ оплаты на ваш выбор. Оплата заказа по частям различными способами невозможна.\rВозможные способы оплаты:\rНаличный расчет\r. \nОплата производится наличными курьеру при доставке или в магазине при самовывозе. Вместе с товаром передается товарный и кассовый чеки, а также гарантийный талон.\rОплата через Сбербанк\r. \nВы можете оплатить заказ в любом отделении Сбербанка. За услугу по переводу денег с вас возьмут от 3 до 7% от стоимости заказа, в зависимости от региона. Перечисление денег займет порядка 10 дней.', '', '', '', 'eae19344e636dec436a80db2742bd70f', NULL, NULL),
(10, '2013-09-19 11:24:08', 'main', 's1|/about/delivery/index.php', 0, NULL, NULL, NULL, '/about/delivery/index.php', 'Доставка', 'Интернет-магазин выполняет доставку любого товара своей собственной Службой доставки.\rСтоимость доставки курьером\rСтоимость доставки товара из нашего магазина - 500 руб, при условии выбора при заказе товара в качестве способа доставки нашим курьером.\rВремя доставки\rВремя доставки согласовывается с менеджером Службы доставки, который обязательно свяжется с вами сразу после того, как вы разместите свой заказ. \rВнимание!\rНеправильно указанный номер телефона, неточный или неполный адрес могут привести к дополнительной задержке! Пожалуйста, внимательно проверяйте ваши персональные данные при регистрации и оформлении заказа.Конфиденциальность ваших регистрационных данных гарантируется.\rДоставка выполняется ежедневно с 10:00 до 20:00 часов, в субботу с 10:00 до 14:00, в воскресенье доставки нет. Товары, заказанные вами в субботу и воскресенье, доставляются в понедельник. Время осуществления доставки зависит от времени размещения заказа и наличия товара на складе:\rесли заказ подтвержден менеджером Службы доставки до 12:00, товар может быть доставлен на следующий рабочий день между 10:00 и 15:00 или между 15:00 и 20:00;\rесли заказ подтвержден менеджером Службы доставки после 12:00, товар может быть доставлен на следующий рабочий день между 15:00 и 18:00.\rВы также можете указать любое другое удобное время доставки, и покупка будет доставлена в удобное вам время. Иное время доставки, а также время доставки в населенные пункты области определяется по договоренности с клиентом.\rМесто доставки\rДоставка осуществляется по адресу, указанному при оформлении заказа. Если необходимо доставить товар по иному адресу, необходимо сообщить адрес менеджеру Службы доставки, который свяжется с вами непосредственно после оформления заказа на сайте.\rПравила\rПри доставке вам будут переданы все необходимые документы на покупку: товарный, кассовый чеки, а также гарантийный талон.При оформлении покупки на организацию, вам будут переданы счет-фактура, а также накладная, в которой необходимо поставить печать вашей организации.Цена, указанная в переданных вам курьером документах, является окончательной, курьер не обладает правом корректировки цены.Стоимость доставки выделяется в документах на покупку отдельной графой.\rВнимание!\rПросим вас помнить, что все технические параметры и потребительские свойства приобретаемого товара вам следует уточнять у нашего менеджера до момента покупки товара. В обязанности работников Службы доставки не входит осуществление консультаций и комментариев относительно потребительских свойств товара. При необходимости инсталляции приобретаемого в нашем магазине товара вам необходимо сообщить об этом нашему менеджеру.При доставке вам заказанного товара проверяйте комплектность доставленного товара, работоспособность товара, соответствие доставленного товара описанию на нашем сайте, также проверьте товар на наличие механических повреждений. При не заявлении вами при получении товара претензий по поводу механических повреждений, в дальнейшем подобные претензии не рассматриваются. В случае вопросов, пожеланий и претензий обращайтесь к нам по следующим координатам:\rСлужба доставки\r: 8 (495) 212 85 06 (многоканальный).\rЭлектронная почта\r: \rsale@dev.may-cat.ru\rSkype\r: \rshipping.example.ru', '', '', '', 'eae19344e636dec436a80db2742bd70f', NULL, NULL),
