INSERT INTO `b_search_content_text` VALUES
(1, 'f58e028735b5d07233c4a161c9231405', 'ПОИСК\r\n\r\n'),
(2, 'be3fe2336ca014ea48484837a6379cf7', 'КАРТА САЙТА\r\n\r\n'),
(3, 'dd63700eb03673944297abca4b736bb0', 'СКЛАДЫ\r\n\r\n'),
(4, 'd66d0a3c77370c595c84e59636a28471', 'ЕСТЬ ИДЕЯ?\r\n\r\n'),
(5, '33ee457328fa92a8537c461193e084dc', 'О МАГАЗИНЕ\r\n\r\n'),
(6, 'a96a2826e484d3d82fc264d64af03e4b', 'ГАРАНТИЯ\r\n\r\n'),
(7, '1d5584090a7d2ea3063e4e5026f58d6e', 'ПОМОЩЬ ПОКУПАТЕЛЮ\r\nВ ЭТОМ РАЗДЕЛЕ ВЫ МОЖЕТЕ НАЙТИ ОТВЕТЫ НА МНОГИЕ ВОПРОСЫ, КАСАЮЩИЕСЯ РАБОТЫ НАШЕГО САЙТА. ЕСЛИ ВЫ НЕ НАШЛИ ИНТЕРЕСУЮЩЕЙ ВАС ИНФОРМАЦИИ, ТО МОЖЕТЕ ОТПРАВИТЬ НАМ ЗАПРОС С ПОМОЩЬЮ \rФОРМЫ ОБРАТНОЙ СВЯЗИ\r.\r\n'),
(8, 'b8612698db842d20607bf3b51b742667', 'ЗАДАЙТЕ ВОПРОС\r\nТЕЛЕФОН:\r8 (495) 212 85 06\rАДРЕС:\rГ. МОСКВА, УЛ. 2-Я ХУТОРСКАЯ, Д. 38\rПРОСМОТРЕТЬ УВЕЛИЧЕННУЮ КАРТУ\rУВАЖАЕМЫЕ ПОКУПАТЕЛИ!\rПРЕЖДЕ ЧЕМ ЗАДАТЬ СВОЙ ВОПРОС, ОБРАТИТЕ ВНИМАНИЕ НА РАЗДЕЛ \rПОМОЩЬ ПОКУПАТЕЛЮ\r. ВОЗМОЖНО, ТАМ УЖЕ ЕСТЬ ИСЧЕРПЫВАЮЩАЯ ИНФОРМАЦИЯ ПО РЕШЕНИЮ ВАШЕЙ ПРОБЛЕМЫ.\r\n'),
(9, '1a1d21a9a7c19b71f24eff15d3e1096b', 'КАК КУПИТЬ\r\nПРОЦЕДУРА ПОКУПКИ ТОВАРА В НАШЕМ ИНТЕРНЕТ-МАГАЗИНЕ ОЧЕНЬ ПРОСТА И СОСТОИТ ИЗ НЕСКОЛЬКИХ ШАГОВ.\r1. ОФОРМЛЕНИЕ ЗАКАЗА\rПОСЛЕ ВЫБОРА ТОВАРА НАЖМИТЕ КНОПКУ \rВ КОРЗИНУ\r— ТОВАР ДОБАВИТСЯ В ВАШУ КОРЗИНУ.\rДАЛЕЕ, ЕСЛИ ВЫ ЗАКОНЧИЛИ ВЫБИРАТЬ ТОВАР, НАЖМИТЕ КНОПКУ \rВАША КОРЗИНА\r.\rНА СТРАНИЦЕ \rВАША КОРЗИНА\rБУДУТ ПЕРЕЧИСЛЕНЫ ВСЕ ВЫБРАННЫЕ ВАМИ ТОВАРЫ.\rВ ПОЛЕ \rКОЛИЧЕСТВО\rВЫ ПОЖЕТЕ ИЗМЕНИТЬ КОЛИЧЕСТВО ТОВАРА ДЛЯ ПОКУПКИ. ПОСЛЕ ИЗМЕНЕНИЯ КОЛИЧЕСТВА ТОВАРА НЕОБХОДИМО НАЖАТЬ КНОПКУ \rПЕРЕСЧИТАТЬ\rДЛЯ ПЕРЕСЧЕТА ИТОГОВОЙ СУММЫ ЗАКАЗА.\nВ КОЛОНКЕ \rДЕЙСТВИЯ\rНАД КАЖДЫМ ТОВАРОМ МОЖНО ПРОИЗВЕСТИ СЛЕДУЮЩИЕ ДЕЙСТВИЯ: ЛИБО \rУДАЛИТЬ\rТОВАР ИЗ КОРЗИНЫ, ЛИБО \rОТЛОЖИТЬ\rТОВАР НА БУДУЩЕЕ.\rТАКЖЕ МОЖНО ВВЕСТИ КОД СКИДКИ В СООТВЕТСТВУЮЩЕЕ ПОЛЕ.\r2. ОФОРМЛЕНИЕ И ПОДТВЕРЖДЕНИЕ ЗАКАЗА\rПОСЛЕ ВВОДА НЕОБХОДИМОЙ ИНФОРМАЦИИ О ДОСТАВКЕ ТОВАРА (ФИО ПОЛУЧАТЕЛЯ, АДРЕС ДОСТАВКИ, КОНТАКТНЫЕ ДАННЫЕ, ВАРИАНТ ДОСТАВКИ, СПОСОБ ОПЛАТЫ И Т.Д) ДЛЯ ОФОРМЛЕНИЯ ЗАКАЗА ВАМ НУЖНО НАЖАТЬ КНОПКУ \rОФОРМИТЬ ЗАКАЗ\r.\rКОПИЯ ЗАКАЗА БУДЕТ ВЫСЛАНА НА ВАШ E-MAIL, УКАЗАННЫЙ ПРИ ОФОРМЛЕНИИ ЗАКАЗА.\rВНИМАНИЕ!\rНЕПРАВИЛЬНО УКАЗАННЫЙ НОМЕР ТЕЛЕФОНА, НЕТОЧНЫЙ ИЛИ НЕПОЛНЫЙ АДРЕС МОГУТ ПРИВЕСТИ К ДОПОЛНИТЕЛЬНОЙ ЗАДЕРЖКЕ! ПОЖАЛУЙСТА, ВНИМАТЕЛЬНО ПРОВЕРЯЙТЕ ВАШИ ПЕРСОНАЛЬНЫЕ ДАННЫЕ ПРИ РЕГИСТРАЦИИ И ОФОРМЛЕНИИ ЗАКАЗА.\rЧЕРЕЗ НЕКОТОРОЕ ВРЕМЯ (ОБЫЧНО В ТЕЧЕНИЕ ЧАСА) ПОСЛЕ ОФОРМЛЕНИЯ ПОКУПКИ, С ВАМИ СВЯЖЕТСЯ НАШ МЕНЕДЖЕР ПО КОНТАКТНЫМ ДАННЫМ, УКАЗАННЫМ ПРИ ОФОРМЛЕНИИ ЗАКАЗА. С МЕНЕДЖЕРОМ МОЖНО БУДЕТ СОГЛАСОВАТЬ ТОЧНОЕ ВРЕМЯ И СРОКИ ДОСТАВКИ, А ТАКЖЕ УТОЧНИТЬ ДЕТАЛИ.\rПРИМЕЧАНИЕ\r: ДЛЯ ПОСТОЯННЫХ КЛИЕНТОВ НА САЙТЕ МАГАЗИНА ЕСТЬ \rРЕГИСТРАЦИЯ\r. В СВОЕМ КАБИНЕТЕ ВЫ МОЖЕТЕ ПРОСМОТРЕТЬ СОДЕРЖИМОЕ КОРЗИНЫ, ИСТОРИЮ СВОИХ ЗАКАЗОВ, А ТАКЖЕ ПОВТОРИТЬ ИЛИ ОТКАЗАТЬСЯ ОТ ЗАКАЗА, ПОДПИСАТЬСЯ НА РАССЫЛКУ НОВОСТЕЙ МАГАЗИНА.\r3. ОПЛАТА И ЦЕНЫ\rЦЕНЫ, УКАЗАННЫЕ НА САЙТЕ, ЯВЛЯЮТСЯ ОКОНЧАТЕЛЬНЫМИ И НЕ ТРЕБУЮТ ДОПЛАТ ПРИ СТАНДАРТНЫХ УСЛОВИЯХ ПОСТАВКИ. ВСЕ НАЛОГИ ВКЛЮЧЕНЫ В СТОИМОСТЬ ТОВАРА.\rВНИМАНИЕ!\rДЛЯ КАЖДОГО ОТДЕЛЬНОГО ЗАКАЗА ВОЗМОЖЕН ТОЛЬКО ОДИН СПОСОБ ОПЛАТЫ НА ВАШ ВЫБОР. ОПЛАТА ЗАКАЗА ПО ЧАСТЯМ РАЗЛИЧНЫМИ СПОСОБАМИ НЕВОЗМОЖНА.\rВОЗМОЖНЫЕ СПОСОБЫ ОПЛАТЫ:\rНАЛИЧНЫЙ РАСЧЕТ\r. \nОПЛАТА ПРОИЗВОДИТСЯ НАЛИЧНЫМИ КУРЬЕРУ ПРИ ДОСТАВКЕ ИЛИ В МАГАЗИНЕ ПРИ САМОВЫВОЗЕ. ВМЕСТЕ С ТОВАРОМ ПЕРЕДАЕТСЯ ТОВАРНЫЙ И КАССОВЫЙ ЧЕКИ, А ТАКЖЕ ГАРАНТИЙНЫЙ ТАЛОН.\rОПЛАТА ЧЕРЕЗ СБЕРБАНК\r. \nВЫ МОЖЕТЕ ОПЛАТИТЬ ЗАКАЗ В ЛЮБОМ ОТДЕЛЕНИИ СБЕРБАНКА. ЗА УСЛУГУ ПО ПЕРЕВОДУ ДЕНЕГ С ВАС ВОЗЬМУТ ОТ 3 ДО 7% ОТ СТОИМОСТИ ЗАКАЗА, В ЗАВИСИМОСТИ ОТ РЕГИОНА. ПЕРЕЧИСЛЕНИЕ ДЕНЕГ ЗАЙМЕТ ПОРЯДКА 10 ДНЕЙ.\r\n'),
(10, '0a457baa7d35cda29d8767c627966645', 'ДОСТАВКА\r\nИНТЕРНЕТ-МАГАЗИН ВЫПОЛНЯЕТ ДОСТАВКУ ЛЮБОГО ТОВАРА СВОЕЙ СОБСТВЕННОЙ СЛУЖБОЙ ДОСТАВКИ.\rСТОИМОСТЬ ДОСТАВКИ КУРЬЕРОМ\rСТОИМОСТЬ ДОСТАВКИ ТОВАРА ИЗ НАШЕГО МАГАЗИНА - 500 РУБ, ПРИ УСЛОВИИ ВЫБОРА ПРИ ЗАКАЗЕ ТОВАРА В КАЧЕСТВЕ СПОСОБА ДОСТАВКИ НАШИМ КУРЬЕРОМ.\rВРЕМЯ ДОСТАВКИ\rВРЕМЯ ДОСТАВКИ СОГЛАСОВЫВАЕТСЯ С МЕНЕДЖЕРОМ СЛУЖБЫ ДОСТАВКИ, КОТОРЫЙ ОБЯЗАТЕЛЬНО СВЯЖЕТСЯ С ВАМИ СРАЗУ ПОСЛЕ ТОГО, КАК ВЫ РАЗМЕСТИТЕ СВОЙ ЗАКАЗ. \rВНИМАНИЕ!\rНЕПРАВИЛЬНО УКАЗАННЫЙ НОМЕР ТЕЛЕФОНА, НЕТОЧНЫЙ ИЛИ НЕПОЛНЫЙ АДРЕС МОГУТ ПРИВЕСТИ К ДОПОЛНИТЕЛЬНОЙ ЗАДЕРЖКЕ! ПОЖАЛУЙСТА, ВНИМАТЕЛЬНО ПРОВЕРЯЙТЕ ВАШИ ПЕРСОНАЛЬНЫЕ ДАННЫЕ ПРИ РЕГИСТРАЦИИ И ОФОРМЛЕНИИ ЗАКАЗА.КОНФИДЕНЦИАЛЬНОСТЬ ВАШИХ РЕГИСТРАЦИОННЫХ ДАННЫХ ГАРАНТИРУЕТСЯ.\rДОСТАВКА ВЫПОЛНЯЕТСЯ ЕЖЕДНЕВНО С 10:00 ДО 20:00 ЧАСОВ, В СУББОТУ С 10:00 ДО 14:00, В ВОСКРЕСЕНЬЕ ДОСТАВКИ НЕТ. ТОВАРЫ, ЗАКАЗАННЫЕ ВАМИ В СУББОТУ И ВОСКРЕСЕНЬЕ, ДОСТАВЛЯЮТСЯ В ПОНЕДЕЛЬНИК. ВРЕМЯ ОСУЩЕСТВЛЕНИЯ ДОСТАВКИ ЗАВИСИТ ОТ ВРЕМЕНИ РАЗМЕЩЕНИЯ ЗАКАЗА И НАЛИЧИЯ ТОВАРА НА СКЛАДЕ:\rЕСЛИ ЗАКАЗ ПОДТВЕРЖДЕН МЕНЕДЖЕРОМ СЛУЖБЫ ДОСТАВКИ ДО 12:00, ТОВАР МОЖЕТ БЫТЬ ДОСТАВЛЕН НА СЛЕДУЮЩИЙ РАБОЧИЙ ДЕНЬ МЕЖДУ 10:00 И 15:00 ИЛИ МЕЖДУ 15:00 И 20:00;\rЕСЛИ ЗАКАЗ ПОДТВЕРЖДЕН МЕНЕДЖЕРОМ СЛУЖБЫ ДОСТАВКИ ПОСЛЕ 12:00, ТОВАР МОЖЕТ БЫТЬ ДОСТАВЛЕН НА СЛЕДУЮЩИЙ РАБОЧИЙ ДЕНЬ МЕЖДУ 15:00 И 18:00.\rВЫ ТАКЖЕ МОЖЕТЕ УКАЗАТЬ ЛЮБОЕ ДРУГОЕ УДОБНОЕ ВРЕМЯ ДОСТАВКИ, И ПОКУПКА БУДЕТ ДОСТАВЛЕНА В УДОБНОЕ ВАМ ВРЕМЯ. ИНОЕ ВРЕМЯ ДОСТАВКИ, А ТАКЖЕ ВРЕМЯ ДОСТАВКИ В НАСЕЛЕННЫЕ ПУНКТЫ ОБЛАСТИ ОПРЕДЕЛЯЕТСЯ ПО ДОГОВОРЕННОСТИ С КЛИЕНТОМ.\rМЕСТО ДОСТАВКИ\rДОСТАВКА ОСУЩЕСТВЛЯЕТСЯ ПО АДРЕСУ, УКАЗАННОМУ ПРИ ОФОРМЛЕНИИ ЗАКАЗА. ЕСЛИ НЕОБХОДИМО ДОСТАВИТЬ ТОВАР ПО ИНОМУ АДРЕСУ, НЕОБХОДИМО СООБЩИТЬ АДРЕС МЕНЕДЖЕРУ СЛУЖБЫ ДОСТАВКИ, КОТОРЫЙ СВЯЖЕТСЯ С ВАМИ НЕПОСРЕДСТВЕННО ПОСЛЕ ОФОРМЛЕНИЯ ЗАКАЗА НА САЙТЕ.\rПРАВИЛА\rПРИ ДОСТАВКЕ ВАМ БУДУТ ПЕРЕДАНЫ ВСЕ НЕОБХОДИМЫЕ ДОКУМЕНТЫ НА ПОКУПКУ: ТОВАРНЫЙ, КАССОВЫЙ ЧЕКИ, А ТАКЖЕ ГАРАНТИЙНЫЙ ТАЛОН.ПРИ ОФОРМЛЕНИИ ПОКУПКИ НА ОРГАНИЗАЦИЮ, ВАМ БУДУТ ПЕРЕДАНЫ СЧЕТ-ФАКТУРА, А ТАКЖЕ НАКЛАДНАЯ, В КОТОРОЙ НЕОБХОДИМО ПОСТАВИТЬ ПЕЧАТЬ ВАШЕЙ ОРГАНИЗАЦИИ.ЦЕНА, УКАЗАННАЯ В ПЕРЕДАННЫХ ВАМ КУРЬЕРОМ ДОКУМЕНТАХ, ЯВЛЯЕТСЯ ОКОНЧАТЕЛЬНОЙ, КУРЬЕР НЕ ОБЛАДАЕТ ПРАВОМ КОРРЕКТИРОВКИ ЦЕНЫ.СТОИМОСТЬ ДОСТАВКИ ВЫДЕЛЯЕТСЯ В ДОКУМЕНТАХ НА ПОКУПКУ ОТДЕЛЬНОЙ ГРАФОЙ.\rВНИМАНИЕ!\rПРОСИМ ВАС ПОМНИТЬ, ЧТО ВСЕ ТЕХНИЧЕСКИЕ ПАРАМЕТРЫ И ПОТРЕБИТЕЛЬСКИЕ СВОЙСТВА ПРИОБРЕТАЕМОГО ТОВАРА ВАМ СЛЕДУЕТ УТОЧНЯТЬ У НАШЕГО МЕНЕДЖЕРА ДО МОМЕНТА ПОКУПКИ ТОВАРА. В ОБЯЗАННОСТИ РАБОТНИКОВ СЛУЖБЫ ДОСТАВКИ НЕ ВХОДИТ ОСУЩЕСТВЛЕНИЕ КОНСУЛЬТАЦИЙ И КОММЕНТАРИЕВ ОТНОСИТЕЛЬНО ПОТРЕБИТЕЛЬСКИХ СВОЙСТВ ТОВАРА. ПРИ НЕОБХОДИМОСТИ ИНСТАЛЛЯЦИИ ПРИОБРЕТАЕМОГО В НАШЕМ МАГАЗИНЕ ТОВАРА ВАМ НЕОБХОДИМО СООБЩИТЬ ОБ ЭТОМ НАШЕМУ МЕНЕДЖЕРУ.ПРИ ДОСТАВКЕ ВАМ ЗАКАЗАННОГО ТОВАРА ПРОВЕРЯЙТЕ КОМПЛЕКТНОСТЬ ДОСТАВЛЕННОГО ТОВАРА, РАБОТОСПОСОБНОСТЬ ТОВАРА, СООТВЕТСТВИЕ ДОСТАВЛЕННОГО ТОВАРА ОПИСАНИЮ НА НАШЕМ САЙТЕ, ТАКЖЕ ПРОВЕРЬТЕ ТОВАР НА НАЛИЧИЕ МЕХАНИЧЕСКИХ ПОВРЕЖДЕНИЙ. ПРИ НЕ ЗАЯВЛЕНИИ ВАМИ ПРИ ПОЛУЧЕНИИ ТОВАРА ПРЕТЕНЗИЙ ПО ПОВОДУ МЕХАНИЧЕСКИХ ПОВРЕЖДЕНИЙ, В ДАЛЬНЕЙШЕМ ПОДОБНЫЕ ПРЕТЕНЗИИ НЕ РАССМАТРИВАЮТСЯ. В СЛУЧАЕ ВОПРОСОВ, ПОЖЕЛАНИЙ И ПРЕТЕНЗИЙ ОБРАЩАЙТЕСЬ К НАМ ПО СЛЕДУЮЩИМ КООРДИНАТАМ:\rСЛУЖБА ДОСТАВКИ\r: 8 (495) 212 85 06 (МНОГОКАНАЛЬНЫЙ).\rЭЛЕКТРОННАЯ ПОЧТА\r: \rSALE@DEV.MAY-CAT.RU\rSKYPE\r: \rSHIPPING.EXAMPLE.RU\r\n'),
